import React from 'react';
import RegistrationI from './RegistrationI';

import Home from "./Home"

const App = () => {
  return (
   <BrowserRouter>
    <Routes>
      <Route path='/' element={<Home />} />
      <Route path='/' element={<RegistrationI />} />
    </Routes>
   </BrowserRouter>
  )
};

export default App;
